import Header from './components/Header';
import Footer from './components/Footer';
import FlightSearchForm from './components/FlightSearchForm';
import './App.css';


function App() {
  return (
    <div>
      <Header />
      <main>
        <h1>Chào mừng đến với QAirlLine!</h1>
        <p>Ứng dụng đặt vé máy bay của bạn.</p>
      </main>
    </div>
  );
}

export default App;
